CREATE TABLE IF NOT EXISTS public.users
(
    id integer NOT NULL GENERATED ALWAYS AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1 ),
    name text COLLATE pg_catalog."default",
    phone text COLLATE pg_catalog."default",
    email text COLLATE pg_catalog."default",
    isadmin boolean DEFAULT false,
    isformdone boolean DEFAULT false,
    CONSTRAINT users_pkey PRIMARY KEY (id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.users
    OWNER to postgres;

CREATE TABLE IF NOT EXISTS public.form_results
(
    id integer NOT NULL GENERATED ALWAYS AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1 ),
    id_user integer,
    json_text text COLLATE pg_catalog."default",
    CONSTRAINT form_results_pkey PRIMARY KEY (id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.form_results
    OWNER to postgres;

CREATE TABLE IF NOT EXISTS public.form_details (
    id integer NOT NULL,
    id_user integer,
    age integer,
    height numeric,
    weight numeric,
    imc numeric,
    skin text,
    hair_loss text,
    eyes_type text,
    neck text,
    waist text,
    blood_circulation text,
    fasts text,
    diarrhea text,
    lack_of_concentration text,
    lack_of_focus text,
    memory_loss text,
    headache text,
    stiff_neck text,
    fatigue text,
    bad_dream text,
    mental_agility text,
    upset_stomach text,
    weight_gain text,
    alcohol_consumption text,
    bad_mood text,
    nails text,
    inflammation text,
    physical_activity text,
    self_esteem text,
    high_cholesterol text,
    triglycerides text,
    low_cholesterol text,
    depression text,
    anxiety text,
    appetite text,
    gases text,
    intestinal_pain text,
    exercise_id integer,
    exercise_minutes integer,
    exercise_days integer,
    gender text
);

ALTER TABLE public.form_details OWNER TO postgres;

ALTER TABLE public.form_details ALTER COLUMN id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME public.form_details_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

ALTER TABLE ONLY public.form_details
    ADD CONSTRAINT form_details_pkey PRIMARY KEY (id);

